            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine of the program </h3>
                <p class=""description""> 
                    Project management, in its modern form, has only begun to take root in the last few decades. From the early 1960s, companies began to realize
                    the utility of organizing project work. This vision of project-based organization grew as organizations began to realize the critical need for their
                    employees to communicate and collaborate in a professional context involving multiple services and professions, and in some cases set of
                    industrial sectors. With this constant, Business Intelligence Institute ");
            WriteLiteral(@"has set up a program of continuous and initial training entitled Management
                    and project management to address the concerns of organizations.
                </p>
            </div>

