                <h3 class=""smaller_heading""> II.2.1. General Objective </h3>
                <p class=""description""> 
                    The Bachelor of Science in Project Management is structured around two inseparable and design-oriented semesters for planning, monitoring and
                    evaluation of projects and programs. The aim is to train managers who are able to employ themselves or to be employed by companies,
                    consulting firms and humanitarian NGOs, by providing them with a foundation of knowledge in project management.                   
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific Objectives </h3>
        ");
