                    <li> Work in all national and international companies and NGOs; </li>
                    <li> Pilot an industrial project, computer, sanitary etc. ; </li>
                    <li> Manage, coordinate a research team for a specific purpose; </li>
                    <li> Elaboration of projects and programs; </li>
                    <li> Strategic and operational planning of the various projects; </li>
                    <li> Development of concept notes for projects; </li>
                    <li> Capitalization of good practices; </li>
                    <li> Participate in the development of tools and guidelines for the collection, compilation and reporting of activity (output) and outcome (outcome) data;</li>
                    <li");
            WriteLiteral(@"> Provide monthly, quarterly, and annual form-based monitoring and evaluation reports to guide management decisions and programming; </li>
